import React from 'react'

export default function customersmall(props) {
    let content=props.customers.map((customer,index) => {
        return (
            <tr key={index}>
                <td>{customer.name}</td>
                <td>Rs {customer.amount}</td>
            </tr>
        )
    })
    return (
        <div className="card">
            <div className="card-body">
                <table>
                    <tbody>
                        {content}
                    </tbody>
                </table>
            </div>
        </div>
    )
}
